function wrongList(){
    function search(name,list){
        var l = list.length;
        for(let i = 0;i<l;i++){
            if(name == list[i].qNum){
                return i;
            }
        }
        return -1;
    }
    this.add = function(){
        function qData(){
            var qNum = document.getElementsByClassName("question-num ng-binding")[0].innerText;
            var title = document.getElementsByClassName("question-txt ng-binding")[0].innerText;
            var question = document.getElementsByClassName("sc-txt ng-binding");
            var answer = document.getElementsByClassName("reference-answer")[0].innerText.replace(/[\n\r\t]/g,"");
            let l = question.length;
            var wData = { "qNum": qNum, "title": title, "question": new Array(l), "answer": answer, "times": 1 };
            for(let i=0;i<l;i++){
                wData.question[i] = question[i].innerText;
            }
            return wData;
        }
        var storage=window.localStorage;
        var qNum = document.getElementsByClassName("question-num ng-binding")[0].innerText;
        var wList = JSON.parse(storage.getItem("wList")) || [];
        var span = document.getElementById("wNum");
        if(wList.length){
            var index = search(qNum,wList);
            if(index == -1){
                let item = qData();
                wList.push(item);
                storage.setItem("wList",JSON.stringify(wList));
                span.innerHTML = "错题数："+String(wList.length);
            } else{
                wList[index].times ++;
                storage.setItem("wList",JSON.stringify(wList));
                span.innerHTML = "错题数："+String(wList.length);
            }
        }else{
            let item = qData();
            wList.push(item);
            storage.setItem("wList",JSON.stringify(wList));
            span.innerHTML = "错题数："+String(wList.length);
        }
    }
    this.remove = function(){
        var storage=window.localStorage;
        let w = JSON.parse(storage.getItem("wList")) || [];
        if(w.length){
            let r = confirm("确认删除错题集吗？");
            if (r == true) {
                storage.removeItem("wList");
                var wList = JSON.parse(storage.getItem("wList")) || [];
                var span = document.getElementById("wNum");
                span.innerHTML = "错题数："+String(wList.length);
            }
        }
    }
    this.save = function(){
        var storage=window.localStorage;
        var wList=JSON.parse(storage.getItem("wList"))||[];

        function fakeClick(obj) {
            var ev = document.createEvent("MouseEvents");
            ev.initMouseEvent("click", true, false, window, 0, 0, 0, 0, 0, false, false, false, false, 0, null);
            obj.dispatchEvent(ev);
        }

        function download(name, data) {
            var urlObject = window.URL || window.webkitURL || window;
            var export_blob = new Blob([data]);
            var save_link = document.createElementNS("http://www.w3.org/1999/xhtml", "a")
            save_link.href = urlObject.createObjectURL(export_blob);
            save_link.download = name;
            fakeClick(save_link);
        }
        function text(wList){
            var l = wList.length;
            var text="";
            for(let i=0;i<l;i++){
                let m=wList[i].question.length
                var qL = "";
                for(let n=0;n<m;n++){
                    qL = qL+wList[i].question[n]+"\n";
                }
                text=text+wList[i].qNum+wList[i].title+"\n"+qL+"\n"+wList[i].answer+"\n\n"
            }
            return text;
        }
        if(wList.length){
            download("错题.txt",text(wList))
            //download("错题.json",JSON.stringify(wList))
        }else{
            alert("没有错题");
        }
    }
    this.show = function(){
        var _this = this;
        var storage=window.localStorage;
        var wList=JSON.parse(storage.getItem("wList"))||[];
        var container = document.getElementsByClassName("question-content");
        let subject = document.getElementsByClassName("subject");
        let span = document.createElement("span");
        span.setAttribute("id", "wNum");
        span.style.margin = "0 10px 0 0";
        span.innerHTML = "错题数："+String(wList.length);
        let div = document.createElement("div");
        div.setAttribute("id", "wList");
        div.style="padding-bottom: 15px; padding-left: 15px; color: #53b01a; font-weight: bold;";
        let button1 = document.createElement("input");
        button1.setAttribute("type", "button");
        button1.setAttribute("value", "清除错题");
        button1.setAttribute("id", "remove");
        button1.style.margin = "0 10px 0 0";
        button1.style.color = "orange";
        button1.onclick = (function(){
            _this.remove()
        });
        let button2 = document.createElement("input");
        button2.setAttribute("type", "button");
        button2.setAttribute("value", "下载错题");
        button2.setAttribute("id", "save");
        button2.style.margin = "0 10px 0 0";
        button2.onclick = (function(){
            _this.save()
        });
        div.appendChild(span);
        div.appendChild(button1);
        div.appendChild(button2);
        container[0].insertBefore(div,subject[0]);
    }
}

function a2o(a){
    let l = a.length,o = {};
    for(let i=0; i<l; i++){
        o[a[i]] = a[i];
    }
    o.length = l;
    return o;
}

function Single(){
    var reset = function(_this){
        _this.truth = "";
        _this.selected = false;
        var answer = document.getElementById("answer");
        var message = document.getElementById("message");
        if (answer){
            answer.remove();
        }
        if (message){
            message.remove();
        }
    }
    this.truth = null;
    this.selected = false;
    this.init = function(){
        var _this = this;
        var answer = document.getElementsByClassName("reference-answer");
        var answerId = answer[0].innerText.replace(/[^A-Z]/g,"");
        answer[0].style = "display:none";
        reset(_this);
        var trueStyle = "padding-top: 20px; border-top: 1px solid #ddd; color: #53b01a; font-weight: bold;";
        var trueText = "回答正确，看来这道题过于简单";
        var falseStyle = "padding-top: 20px; border-top: 1px solid #ddd; color: red; font-weight: bold;";
        var falseText = "瞧你的小脑袋瓜，这都能答错！";
        var select = function(style,text){
            let answerId = document.getElementsByClassName("reference-answer");
            let adiv = document.createElement("div");
            adiv.setAttribute("id", "answer");
            adiv.style="padding-top: 20px; border-top: 1px solid #ddd; color: #53b01a; font-weight: bold;"
            let answer = document.createTextNode(answerId[0].innerText);
            adiv.appendChild(answer);
            container[0].appendChild(adiv);
            let div = document.createElement("div");
            div.setAttribute("id", "message");
            div.style = style;
            let message = document.createTextNode(text);
            div.appendChild(message);
            container[0].appendChild(div);
        }
        var container = document.getElementsByClassName("subject");
        var question = document.getElementsByClassName("sc-txt ng-binding");
        for(let i=0;i<question.length;i++){
            let questionId = question[i].innerText.substring(0,1);
            if(questionId == answerId){
                _this.truth = i;
            }
            question[i].onclick=(function(param){
                if(!_this.selected){
                    _this.selected = true;
                    question[_this.truth].style = "background-color: green;color:white";
                    if(questionId != answerId){
                        question[i].style = "background-color: red;color:white";
                        select(falseStyle,falseText);
                        //此处收集错题
                        var WL = new wrongList();
                        WL.add();
                    }else{
                        select(trueStyle,trueText);
                    }
                }
            })
        }
    }
}

function Multiple(){
    var reset = function(_this){
        _this.truth = "";
        _this.select = "";
        _this.selected = false;
        var answer = document.getElementById("answer");
        var message = document.getElementById("message");
        if (answer){
            answer.remove();
        }
        if (message){
            message.remove();
        }
    }
    this.truth = "";
    this.select = "";
    this.selected = false;
    this.init=function(){
        var _this = this;
        var answer = document.getElementsByClassName("reference-answer");
        answer[0].style = "display:none";
        reset(_this);
        _this.truth = answer[0].innerText.replace(/[^A-Z]/g,"");
        var container = document.getElementsByClassName("subject");
        var question = document.getElementsByClassName("sc-txt ng-binding");
        for(let i=0;i<question.length;i++){
            let questionId = question[i].innerText.substring(0,1);
            question[i].onclick=(function(param){
                if(!_this.selected){
                    if(_this.select.indexOf(questionId) == -1){
                        question[i].style = "background-color:#DCDCDC";
                        _this.select = _this.select + questionId;
                    }else{
                        _this.select = _this.select.replace(questionId,"")
                        question[i].style = "background-color:none";
                    }
                }
            })
        }
    }
    var _this = this;
    var trueStyle = "padding-top: 20px; border-top: 1px solid #ddd; color: #53b01a; font-weight: bold;";
    var trueText = "回答正确，看来这道题过于简单";
    var falseStyle = "padding-top: 20px; border-top: 1px solid #ddd; color: red; font-weight: bold;";
    var falseText = "瞧你的小脑袋瓜，这都能答错！";
    var submit = function(style,text){
        let answerId = document.getElementsByClassName("reference-answer");
        let adiv = document.createElement("div");
        adiv.setAttribute("id", "answer");
        adiv.style="padding-top: 20px; color: #53b01a; font-weight: bold;"
        let answer = document.createTextNode(answerId[0].innerText);
        adiv.appendChild(answer);
        container[0].appendChild(adiv);
        let div = document.createElement("div");
        div.setAttribute("id", "message");
        div.style = style;
        let message = document.createTextNode(text);
        div.appendChild(message);
        container[0].appendChild(div);
    }
    var container = document.getElementsByClassName("subject");
    let div = document.createElement("div");
    div.setAttribute("id", "submit");
    div.style="padding-top: 20px; border-top: 1px solid #ddd; color: #53b01a; font-weight: bold;";
    let button = document.createElement("input");
    button.setAttribute("type", "button");
    button.setAttribute("value", "提交");
    button.setAttribute("id", "button");
    button.style.width = "150px";
    button.onclick = (function(){
        if(!_this.selected){
            _this.selected = true;
            let asw = document.getElementById("answer");
            let msg = document.getElementById("message");
            if (asw){
                asw.remove();
            }
            if (msg){
                msg.remove();
            }
            if(_this.select.length == _this.truth.length){
                var selectArr = _this.select.split("");
                var answerDict = a2o(_this.truth.split(""));
                var allTrue = true;
                let l = selectArr.length;
                for(let i=0;i<l;i++){
                    if(selectArr[i] in answerDict == false){
                        allTrue = false;
                        break;
                    }
                }
                if(allTrue) {
                    submit(trueStyle,trueText);
                }else{
                    submit(falseStyle,falseText);
                    //此处收集错题
                    let WL = new wrongList();
                    WL.add();
                }
            }else{
                submit(falseStyle,falseText);
                //此处收集错题
                let WL = new wrongList();
                WL.add();
            }
        }
    });
    div.appendChild(button);
    container[0].appendChild(div);
}

function router(){
    var url = window.location.href;
    var id1 = "subjectId=o1buajgh2seASEaMdPAc8aTmk2uDykJk";
    var id2 = "subjectId=o1cuvfjsf587zSpiKK4Bf8qJ9wpOf1FA";
    var id3 = "subjectId=o1cuvfjsc1bykuGutUkEgbz8ruaKjXkb";
    var id4 = "subjectId=o1cuvfjsdjf8V3Egx5Q7L9uwt3sSfwy6";
    if(url.indexOf(id1) != -1){
        return new Single();
    }else if(url.indexOf(id2) != -1 || url.indexOf(id3) != -1 || url.indexOf(id4) != -1){
        return new Multiple();
    }
}

function Donate(){
    var	QRCODE = "data:image/png;base64,";
    var	QRCODE2 = "data:image/jpeg;base64,";
    var scroll = document.querySelector(".scrollable-content");
    let donateText = document.createElement("div");
    donateText.innerText = "打赏是对作者最大的鼓励";
    donateText.style="padding-left: 10px;font-weight: bold;";
    let donateBox = document.createElement("div");
    donateBox.style="display:flex;flex-direction:row;align-items:flex-start;justify-content:flex-start;flex-wrap: wrap";
    let donateQR = document.createElement("img");
    donateQR.src = QRCODE;
    donateQR.setAttribute("id", "donateQR");
    donateQR.style="padding-left:10px;width:300px;object-fit:contain;";
    donateQR.onclick=()=>{
        previewImage(QRCODE);
    }
    let donateQR2 = document.createElement("img");
    donateQR2.src = QRCODE2;
    donateQR2.setAttribute("id", "donateQR2");
    donateQR2.style="padding-left:10px;width:300px;object-fit:contain;";
    donateQR2.onclick=()=>{
        previewImage(QRCODE2);
    }
    donateBox.appendChild(donateQR);
    donateBox.appendChild(donateQR2);
    scroll.appendChild(donateText);
    scroll.appendChild(donateBox);
}

function previewImage(src,callback = null){
    var img = `<img src='${src}' style='width:100%;height:100%;object-fit:contain'/>`;
    var mask = document.createElement("div");
    mask.style.position="fixed";
    mask.style.top="0";
    mask.style.right="0";
    mask.style.bottom="0";
    mask.style.left="0";
    mask.style.background="rgba(0,0,0,0.5)";
    mask.style.zIndex="999";
    var btn = document.createElement("button");
    btn.innerText = "✕";
    btn.style.width = "30px";
    btn.style.height = "30px";
    btn.style.position="absolute";
    btn.style.top="20px";
    btn.style.right="20px";
    btn.style.border="none";
    btn.style.borderRadius="50%";
    btn.style.background="rgba(255,255,255,0.5)";
    btn.style.textAlign="center";
    btn.onclick=()=>{
        document.body.removeChild(mask);
        typeof callback == "function" && callback();
    }
    btn.onmouseenter=()=>{
        btn.style.background="rgba(255,0,0,1)";
        btn.style.color="#FFFFFF";
    }
    btn.onmouseleave=()=>{
        btn.style.background="rgba(255,255,255,0.5)";
        btn.style.color="#000000";
    }
    mask.innerHTML += img;
    mask.appendChild(btn);
    document.body.appendChild(mask);
}

(function() {
    'use strict';
    // Your code here...
    Donate();
    var subjectType = router();
    subjectType.init();
    var WL = new wrongList();
    WL.show();
    var qNum = document.querySelector(".question-num",".ng-binding");
    let config = { attributes: true, childList: true, subtree: true };
    let observer = new MutationObserver(mutations => {
        subjectType.init();
    })
    observer.observe(qNum, config);
})();